import React from "react";
import { NavLink } from 'react-router-dom';

function Home() {

  return (
    <>
      <ul className="unlogged-nav-bar">
        <li><NavLink to="/about" className="nav-button-empty">About</NavLink></li>
        <li><NavLink to="/login" className="nav-button-empty">Login</NavLink></li>
        <li><NavLink to="/signup" className="nav-button-filled">Signup</NavLink></li>
        <li><NavLink to="/settings" className="nav-icon settings"><i class="fa fa-cog" aria-hidden="true"></i></NavLink></li>
      </ul>
      <div className="background-image home-trees"><img alt="trees" src=""/></div>
      <h1>The Forest</h1>

      <NavLink to="/start" className="nav-button-filled">Start Game</NavLink>
    </>
  )
}

export default Home
